import React from "react";

const Slotmachine = (props) => {
  props.x === props.y && props.y === props.z ? (
    <>
      <div className="slot_inner">
        <h1>
          {props.x}
          {props.y}
          {props.z}
        </h1>
        <h1>You Won</h1>
        <hr />
      </div>
    </>
  ) : (
    <>
      <div className="slot_inner">
        <h1>
          {props.x}
          {props.y}
          {props.z}
        </h1>
        <h1>you lost</h1>
        <hr />
      </div>
    </>
  );
};
export default Slotmachine;
